import React, { useState, useEffect } from "react";
import AddLinkForm from "../components/AddLinkForm";
function LinkTable() {
  return (
    <div>
      <table className="table table-striped">
        <thead>
          <tr>
            <th scope="col">id</th>
            <th scope="col">Title</th>
            <th scope="col">Link</th>
            <th scope="col">Tags</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

function FilterInput() {
  return (
    <div className="md-form form-group mt-5">
      <input
        type="text"
        className="form-control"
        id="formGroupExampleInput2MD"
        placeholder="Filter"
      />
    </div>
  );
}

function SharelinkPage() {
  const [title, setTitle] = useState("");
  const [url, setUrl] = useState("");
  const [tag, setTag] = useState("");

  function titleOnChange(event) {
    setTitle(event.target.value);
  }
  function urlOnChange(event) {
    setUrl(event.target.value);
  }
  function tagOnChange(event) {
    setTag(event.target.value);
  }
  return (
    <div className="container">
      <h1>Sharelink Page</h1>

      <AddLinkForm />
      <FilterInput />
      <LinkTable />
    </div>
  );
}

export default SharelinkPage;
